import React from 'react';
import PropTypes from 'prop-types';

const Display = (props) => (
  <div>
    <span>{props.result}</span>
  </div>
);

Display.propTypes = {
  result: PropTypes.string,
};

Display.defaultProps = {
  result: '0',
};

export default Display;
